import React from "react";

const Form = () => {
    const [inputs, setInputs] = React.useState({
        name: "",
        age: "",
        armyNum: "",
        id: "",
        password: "",
    });
    const onSubmit = (event) => {
        event.preventDefault();
        const { value, name } = event.target;
        setInputs({
            [name]: value,
        });
    }

    return <form action="/" onSubmit={onSubmit}>
        <p>
            <label htmlFor="enterName">이름 </label>
            <input id="enterName" placeholder="input your name"></input>
        </p>
        <p>
            <label htmlFor="enterAge">나이 </label>
            <input id="enterAge" placeholder="input your age"></input>
        </p>
        <p>
            <label htmlFor="enterArmy">군번 </label>
            <input id="enterArmy" placeholder="input your armyNum"></input>
        </p>
        <p>
            <label htmlFor="enterId">아이디 </label>
            <input id="enterId" placeholder="input your id"></input>
        </p>
        <p>
            <label htmlFor="enterPassword">비밀번호 </label>
            <input id="enterPassword" placeholder="input your Password"></input>
        </p>
        <p>
            <label htmlFor="enterPassword">비밀번호 재확인 </label>
            <input id="enterPassword" placeholder="input your Password"></input>
        </p>
    </form>
}

export default Form;
